import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 32, height: 32, viewBox: "0 0 32 32", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M3 16a1 1 0 011-1h21.59l-8.3-8.3a1 1 0 011.42-1.4l10 10a1 1 0 010 1.4l-10 10a1 1 0 01-1.42-1.4l8.3-8.3H4a1 1 0 01-1-1z", fill: primaryFill }));
};
const ArrowRight32Regular = wrapIcon(rawSvg({}), 'ArrowRight32Regular');
export default ArrowRight32Regular;
